    "Potential impacts of human physical disturbance on benthic communities in tributaries
    of the Niobrara National Scenic River",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-29T18:57:55.037000",nt"name": "potential-impacts-of-human-physical-disturbance-on-benthic-communities-in-tributaries-of-t",nt"isopen":
    false,nt"url": null,nt"notes": "The Niobrara National Scenic River is a
    popular location for tourists to canoe, tube, kayak, swim and fish. The more than
    200 waterfalls in the area are a major attraction for visitors. Consequently, it
    is a common practice for visitors to beach their canoes at the mouth of the tributary
    and to hike mid-stream between steep canyon walls to view the falls. Thus, the potential
    for significant benthic community disturbance exists. Frequent bottom trampling
    and bank destabilization can result in a variety of short and long-term changes,
    including bottom substrate degradation, higher levels of drift including premature
    drift of aquatic larvae, increased turbidity and sedimentation, and the elimination
    of sensitive species.  This study aims to assess the relative extent of benthic
    macroinvertebrate community disturbance by visitors in tributaries to the Niobrara
    National Scenic River and its overall impact on stream ecosystem health.",nt"license_title":
